import { Section } from 'react-bulma-components';
import classes from './Mission.module.css';

const Mission = () => {
    return (
        <Section><div className={classes.section-title}>Mission:</div>To provide seamless secure car payment and adaptive digital insurance to encourage the transition to autonomous connected vehicles.</Section>
    )
}

export default Mission
